import React from "react";
import Home from "./Home";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  BrowserRouter,
} from "react-router-dom";
import "../style.scss";
import Weather from "./Weather";

function App() {
  return (
    <>
      {/* <Home /> */}
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<Home />} />
          <Route path="/weather" exact element={<Weather />} />
          {/* <Redirect to='/home' /> */}
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
